    base = 2**(k-1)
    for i in range(1,k+1): 
        compiled = [x//base for x in primes]
        heap = []
        for j in compiled: 
            heap.append((j,j))
        heapq.heapify(heap)
        while heap: 
            yield heapq.heappop(heap)
